INGREDIENTS:
1 can of spam
5-6 eggs
salt
Pepper
Dash of water

SPAM MUSUBI SAUCE
2 TBS soy sauce
1.5 TBS sugar

PREPPING:
1. Crack 5-6 eggs in a mixing bowl. Add salt, pepper, a dash of water and whisk
2. On high heat, heat up some oil. When your oil get hot, pour in your eggs & turn your heat to low. Cook your eggs through (do no cover/ place a lid over)
3. While your eggs are cooking, mix all of your ingredients under â€œspam Musubi sauceâ€ & set aside until we need her
4. Cut your spam up into 8 equal pieces

COOKING:
5. Heat up a new skillet with some oil & sear your spam for 2-4 minutes flipping half way through (do not throw the spam can away)
6. Once both sides have been seared, pour in your spam musubi sauce and cook until your sauce slightly thickens.
7. Flip your spam once more & turn off your heat. You want the sauce to cover both sides of your spam
8. By now, your eggs should be done cooking. Remove your eggs from the skillet.
9. Use the spam can to cut out your eggs

TO ASSEMBLE:
10. you will need a mold (link in my bio under â€œAmazon favoritesâ€ > â€œKitchenâ€) or you can use the spam can. Just line your can with seran wrap, place ur ingredients in, pack everything in using a spoon & lift you Musubi up with you seran wrap.

